// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./libraries/Message.sol";
import "./libraries/TypeCasts.sol";
import "./libraries/CallFlags.sol";
import "./libraries/Structs.sol";

import "./interfaces/ISwayCall.sol";
import "./interfaces/ISwayCallApp.sol";

import "./interfaces/ISwayCallPay.sol";

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/access/Ownable2Step.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Supernova is Context, Ownable2Step, ISwayCallApp {
    using Message for bytes;
    using TypeCasts for bytes32;
    using TypeCasts for address;

    uint32 private immutable CHAIN_ID;
    address private constant NATIVE =
        0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;

    mapping(bytes32 => address) private _pairs;
    mapping(uint32 => bytes32) private _destChains;

    ISwayCall private _swayCall;
    ISwayCallPay private _swayCallPay;

    constructor(
        address swayCall_,
        address swayCallPay_,
        uint32 chainId_
    ) Ownable2Step() {
        _swayCall = ISwayCall(swayCall_);
        _swayCallPay = ISwayCallPay(swayCallPay_);
        CHAIN_ID = chainId_;
    }

    mapping(address => uint256) private _reserves;

    function fund(uint256 amount, address token) external payable {
        uint256 _amount = amount;

        if (token == NATIVE) {
            _amount = msg.value;
        } else {
            IERC20(token).transferFrom(_msgSender(), address(this), amount);
        }

        _reserves[token] += amount;
    }

    function bridge(
        uint32 destChainId,
        address token,
        uint256 amount,
        bytes32 receiver
    ) external payable {
        if (token == NATIVE) {
            _bridge(destChainId, NATIVE, msg.value, receiver);
        } else {
            IERC20(token).transferFrom(_msgSender(), address(this), amount);
            _bridge(destChainId, token, amount, receiver);
        }
    }

    function _bridge(
        uint32 destChainId,
        address token,
        uint256 amount,
        bytes32 receiver
    ) private {
        require(_destChains[destChainId].length != 0, "NO_DEST_CHAIN");

        _reserves[token] += amount;

        bytes32 destContractId = _destChains[destChainId];
        Structs.SCPayloadData memory data = Structs.SCPayloadData({
            slot0U32: 0,
            slot1U32: 0,
            slot0U64: (amount / 1_000_000_000),
            slot1U64: 0,
            slot2U64: 0,
            slot0B256: token.addressToBytes32(),
            slot1B256: receiver,
            slot2B256: "",
            slot3B256: ""
        });

        // pay gas
        uint256 receiptId = _swayCallPay.payGas(destChainId, address(this));

        // dispatch
        _swayCall.swayDispatch(
            destContractId,
            address(this),
            data,
            destChainId,
            CallFlags.PAY_FROM_SWAYCALL,
            receiptId
        );
    }

    function addDestChain(
        uint32 chainID,
        bytes32 contractId
    ) external onlyOwner {
        _destChains[chainID] = contractId;
    }

    // SwayCall execute
    function execute(
        uint256, // fromChainId
        Structs.SCPayloadData calldata data
    ) external override {
        uint256 amount = data.slot0U64;
        bytes32 token = data.slot0B256;
        address receiver = data.slot1B256.bytes32ToAddress();

        address pair = _pairs[token];
        require(_reserves[pair] >= amount, "INSUFFICIENT_AMOUNT");

        _reserves[pair] -= amount;

        if (pair == NATIVE) {
            (bool success, ) = receiver.call{value: amount}("");
            require(success, "TRANSFER_FAILED_ETH");
        } else {
            IERC20(pair).transfer(receiver, amount);
        }
    }

    function addPair(bytes32 token0, address token1) external onlyOwner {
        _pairs[token0] = token1;
    }

    // SwayCall result
    function onResult(bytes memory data) external {}

    function feePayer() external view override returns (address) {
        return owner();
    }

    function feeIdentifier() external pure override returns (string memory) {
        return "Supernova DEx";
    }
}
